const Rightbar = () => {
    return (
        <div>
            <div className="rightbar">
                <div className="rightbar_wrapper">
                    <span className="birthday_notifaction"><strong>Hari</strong> and <strong>2 other</strong> have birthday today.</span>

                </div>
            </div>
        </div>
    )
}

export default Rightbar
